    static int[] climbingLeaderboard(int[] scoresToAddToLeaderboard, int[] aliceScores) {


        Map<Integer,Integer> currentStateOfLeaderboard = new HashMap<>();
        int counter = 1;
        for (int score: scoresToAddToLeaderboard){
            currentStateOfLeaderboard.put(score, counter);
            counter++;
        }
        currentStateOfLeaderboard = (currentStateOfLeaderboard);

        HashMap<Integer, Integer> leaderboardMap = new HashMap<>();
        for(int i = 0; i<currentStateOfLeaderboard.size(); i++){
            leaderboardMap.put(i+1, currentStateOfLeaderboard.get(i));
        }

        int[] alicePositionsOnLeaderboard = new int[aliceScores.length];

        int positionOfAlice = 0;
        for (int i=0; i < aliceScores.length; i++){

            List<Integer> leaderboardScores = new ArrayList<>(leaderboardMap.values());
            HashSet<Integer> l2 = new HashSet<>(leaderboardMap.values());
            int existenceInLeaderboard = Collections.binarySearch(leaderboardScores,aliceScores[i]);

            //System.out.println("Alice score of " + aliceScores[i] + " has binary value of: " + existenceInLeaderboard);
            if(existenceInLeaderboard > 0){
                positionOfAlice = leaderboardScores.size() - existenceInLeaderboard;
                alicePositionsOnLeaderboard[i] = positionOfAlice;
            }
            else if(existenceInLeaderboard == 0){
                positionOfAlice = leaderboardScores.size();
                alicePositionsOnLeaderboard[i] = positionOfAlice;
            }
            else{
                positionOfAlice = leaderboardScores.size() + 2 + existenceInLeaderboard;
                alicePositionsOnLeaderboard[i] = positionOfAlice;
            }



        }
        return alicePositionsOnLeaderboard;
    }
